import { FETCH_MOVIES_START, FETCH_MOVIES_SUCCESS, FETCH_MOVIES_ERROR } from '../constants/constants';

const initialState = {
    data: []
}

export const reducer = (state=initialState, action) => {
    switch(action.type){
        default:
            return state
    }
}
